import React, { useState, useContext, useEffect } from 'react'; 
import Swal from 'sweetalert2';
import axios from 'axios';
import { UserContext } from '../context/UserContext';
import { useNavigate } from 'react-router-dom';

const ConfirmationReserve = () => {
  const [parkingOption, setParkingOption] = useState('Parking1');
  const [hoursOption, setHoursOption] = useState('1');

  const handleParkingChange = (e) => {
    const selectedParkingOption = e.target.value;
    setParkingOption(selectedParkingOption);
  };

  const handleHoursChange = (e) => {
    const selectedHoursOption = e.target.value;
    setHoursOption(selectedHoursOption);
  };


  const { user } = useContext(UserContext);

  const [place, setPlaces] = useState([]);

  const navigate = useNavigate();

  useEffect(() => {
    fetchPlace();
  }, []);


  const fetchPlace = async () => {
    try {
        const response = await axios.get('http://localhost:5000/parkingform');
        console.log(response)
        setPlaces(response.data);
    } catch (error) {
        console.error(error);
    }
  };



  const handleConfirmReservation = async (placeId) => {

    const values = {
        userId: user.id,
        placeId: placeId,

    }



    try {
        const response = await axios.post('http://localhost:5000/reserves', values);
        console.log(response.data);
        Swal.fire({
            icon: 'success',
            title: 'Reserva correcta',
            showConfirmButton: false,
            timer: 1800
        });
        navigate('/reserves');
    } catch (error) {
        console.log(error);
    }
};



  return (
    <div className="container" style={{ width: '50%', marginTop: '50px' }}>
      <div style={{ textAlign: 'center' }}>
          <h1>Confirmación de Reserva</h1>
          <div style={{ width: '100%', backgroundColor: '#F5B041', height: '5px', margin: 'auto', marginBottom: '20px' }}></div>
      </div>
      <form>
        <div className="mb-3" style={{ marginTop: '50px' }}>
          <label htmlFor="parkingOption" className="form-label">
            <h4>Parking</h4>
          </label>
          <select
            className="form-select"
            id="parkingOption"
            name="parkingOption"
            value={parkingOption}
            onChange={handleParkingChange}
          >
            <option value="Parking1">Parking San Martín</option>
            <option value="Parking2">Parking Francia</option>
            <option value="Parking3">Parking Plaza España</option>
          </select>
        </div>
        <div className="mb-3">
          <label htmlFor="hoursOption" className="form-label">
            <h4>Seleccione la duración</h4>
          </label>
          <select
            className="form-select"
            id="hoursOption"
            name="hoursOption"
            value={hoursOption}
            onChange={handleHoursChange}
          >
            <option value="1">1 hora</option>
            <option value="turno">Turno (4 horas)</option>
            <option value="medio-dia">Medio día (12 horas)</option>
            <option value="dia-completo">Día completo(24 horas)</option>
          </select>
        </div>
        <div className="mb-3">
          <label htmlFor="totalPrice" className="form-label">
            <h4>Precio Total</h4>
          </label>
          <input
            type="text"
            className="form-control"
            id="totalPrice"
            name="totalPrice"

            readOnly
          />
        </div>
        <div style={{ textAlign: 'center' }}>
          <button
            type="button"
            className="btn btn-warning text-white"
            onClick={handleConfirmReservation}
          >
            Confirmar Reserva
          </button>
        </div>
      </form>
    </div>
  );
};

export default ConfirmationReserve;
